import React from 'react';
import { useNavigate } from 'react-router-dom';
import logo from './assets/Logo.jpeg';

const Register = () => {
    const navigate = useNavigate();

    const styles = {
        container: {
            height: '100vh', width: '100vw',
            background: 'radial-gradient(circle at center, #1b0033 0%, #000000 100%)',
            display: 'flex', justifyContent: 'center', alignItems: 'center'
        },
        card: {
            background: 'rgba(255, 255, 255, 0.04)',
            backdropFilter: 'blur(25px)',
            WebkitBackdropFilter: 'blur(25px)',
            padding: '50px 45px',
            borderRadius: '40px',
            width: '440px',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            border: '1px solid rgba(255, 255, 255, 0.1)',
            boxShadow: '0 25px 50px rgba(0,0,0,0.6)'
        },
        input: {
            width: '100%', padding: '16px 20px', margin: '10px 0',
            borderRadius: '14px', border: '1px solid rgba(255,255,255,0.1)',
            background: 'rgba(255,255,255,0.05)', color: 'white', fontSize: '15px', outline: 'none'
        }
    };

    return (
        <div style={styles.container}>
            <div style={styles.card}>
                <img src={logo} alt="Trellis" style={{width: '140px', mixBlendMode: 'screen', marginBottom: '20px'}} />
                <h2 style={{color: 'white', fontSize: '24px', fontWeight: '800', marginBottom: '30px', letterSpacing: '3px'}}>SIGN UP</h2>
                <input style={styles.input} type="text" placeholder="Full Name" required />
                <input style={styles.input} type="email" placeholder="Email Address" required />
                <input style={styles.input} type="password" placeholder="Create Password" required />
                <button style={{width: '100%', padding: '18px', marginTop: '20px', background: 'linear-gradient(135deg, #9133ff 0%, #6a00f4 100%)', color: 'white', border: 'none', borderRadius: '14px', fontWeight: '700', fontSize: '16px', cursor: 'pointer'}}>
                    REGISTER
                </button>
                <div style={{marginTop: '30px', color: '#999', fontSize: '14px'}}>
                    Already registered? <span onClick={() => navigate('/')} style={{color: '#9133ff', fontWeight: '700', cursor: 'pointer', marginLeft: '5px'}}>Login Here</span>
                </div>
            </div>
        </div>
    );
};

export default Register;
